script: |
  super -f text -I q3175.spq | sort > q3175.out

inputs:
  - name: q3175.spq
    data: |
      SELECT DISTINCT + COUNT ( * ) * 14 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN - ( - + col0 ) / + - CAST ( - - 39 AS REAL ) AND 65 * - col2 + - + col0;
  - name: tab0

outputs:
  - name: q3175.out
    data: |
      42
